Following World War III, all the nations of the world agreed to 50 years of strict isolation from one another in order to prevent additional conflicts. 50 years later, the United States comes out of exile, only to learn that no one else went into isolation. This discovery is truly shocking to the president of the United States at the time. Her name is Soeurette Morley and she decides to go on a rampage to make up for the fact that the U.S. has now lagged behind other countries so much to the extent that the United States is now no longer a global superpower. 
The United States is now a third world country.
 Soeurette Morley has been elected president for life and has been ruling the country with an iron fist for the past 50 years. Soeurette is determined to show the other countries in the world who's boss, but this is difficult because the past 50 years have put the U.S. at an extreme disadvantage relative to the other countries that did not go into isolation. By going into isolation, the U.S. ended up cutting itself off of all trade opportunities. The economy tanked. Innovation ceased. There was really no more motivation to create anything or do anything in the U.S. since there was no point;
